import React from "react";
import "./ListTweet.scss";

const ListTweet = (props) => {
  const { allTweets } = props;

  if (!allTweets || allTweets.length === 0) {
    return <div className="divListTweet">No Hay Tweets</div>;
  } else {
    return <div className="divListTweet">Hay Tweets</div>;
  }
};

export default ListTweet;
